		<div className={classes.Center}>
			{props.img.map( el => { return <div className={classes.img}><img src={el.img} key={el.key +el.img}/></div>})}
		</div>

	</section>
}


const mapStateToProps = (state) => {
    return{
    	img:state.Instagram.img
    }
}

